// ENUMS
// -----

enum major_category: uint8_t
{
    letter,
    mark,
    number,
    separator,
    other,
    punctuation,
    symbol
};

enum category: uint8_t
{
    uppercase_letter = 0,   // [Lu] an uppercase letter
    lowercase_letter,       // [Ll] a lowercase letter
    titlecase_letter,       // [Lt] a digraphic character, with first part uppercase
    modifier_letter,        // [Lm] a modifier letter
    other_letter,           // [Lo] other letters, including syllables and ideographs

    nonspacing_mark = 8,    // [Mn] a nonspacing combining mark (zero advance width)
    enclosing_mark,         // [Me] an enclosing combining mark
    spacing_mark,           // [Mc] a spacing combining mark (positive advance width)

    decimal_number = 16,    // [Nd] a decimal digit
    letter_number,          // [Nl] a letterlike numeric character
    other_number,           // [No] a numeric character of other type

    space_separator = 24,   // [Zs] a space character (of various non-zero widths)
    line_separator,         // [Zl] U+2028 LINE SEPARATOR only
    paragraph_separator,    // [Zp] U+2029 PARAGRAPH SEPARATOR only

    control = 32,           // [Cc] a C0 or C1 control code
    format,                 // [Cf] a format control character
    private_use,            // [Co] a private-use character
    surrogate,              // [Cs] a surrogate code point
    unassigned,             // [Cn] a reserved unassigned code point or a noncharacter

    dash_punctuation = 40,  // [Pd] a dash or hyphen punctuation mark
    open_punctuation,       // [Ps] an opening punctuation mark (of a pair)
    close_punctuation,      // [Pe] a closing punctuation mark (of a pair)
    connector_punctuation,  // [Pc] a connecting punctuation mark, like a tie
    other_punctuation,      // [Po] a punctuation mark of other type
    initial_punctuation,    // [Pi] an initial quotation mark
    final_punctuation,      // [Pf] a final quotation mark

    math_symbol = 48,       // [Sm] a symbol of primarily mathematical use
    currency_symbol,        // [Sc] a currency sign
    modifier_symbol,        // [Sk] a non-letterlike modifier symbol
    other_symbol            // [So] a symbol of other type
};

enum derived_properties: uint16_t
{
    alphabetic = 64,
    uppercase = 128,
    lowercase = 256,
    white_space = 512,
    hex_digit = 1024,
    noncharacter_code_point = 2048,
    default_ignorable_code_point = 4096
};

// HELPERS -- CHARACTERS
// ---------------------


static uint32_t assert_strict(bool strict)
{
    if (strict) {
        throw std::runtime_error("Illegal character encountered.");
    }
    return 0x0000FFFDul;
}


static bool is_nth_bit_set(uint8_t c, int n)
{
    return (1 << n) & c;
}


static uint16_t category_lookup(uint32_t c)
{
    uint32_t block_offset = CATEGORY_STAGE1[c / 256] * 256;
    return CATEGORY_STAGE2[block_offset + c % 256];
}


static uint8_t get_category(uint32_t c)
{
    return category_lookup(c) & 0x3F;
}


static uint8_t get_major_category(uint32_t c)
{
    return get_category(c) >> 3;
}


/**
 *  \brief Determine if byte is ASCII.
 */
bool is_ascii_byte(uint8_t c)
{
    return 0 == (c & ~0x7f);
}


/**
 *  \brief Determine if byte is a start byte.
 *
 *  Start bytes initialize with a 11 bit pattern.
 */
bool is_start_byte(uint8_t c)
{
    return c > 0xbf;
}


/**
 *  \brief Determine if byte is a continuation byte.
 *
 *  Continuation bytes initialize with a 10 bit pattern.
 */
bool is_continuation_byte(uint8_t c)
{
    return c >= 0x80 && c<= 0xbf;
}


/**
 *  \brief Check if the byte is a valid sequence.
 *
 *  Valid bytes are either the start and < 128 (ASCII) or a start byte,
 *  or a continuation byte.
 */
static bool is_valid_byte(uint8_t byte, bool is_continuation)
{
    if (is_continuation) {
        return is_continuation_byte(byte);
    }
    return byte < 0x80 || is_start_byte(byte);
}


/**
 *  \brief Check if the byte is a valid sequence.
 */
static bool is_valid_byte(uint8_t byte, bool is_continuation, bool strict)
{
    bool status = is_valid_byte(byte, is_continuation);
    if (!status && strict) {
        throw std::runtime_error("Invalid byte encountered.");
    }
    return status;
}


/** \brief Convert UTF-32 character to UTF-16.
 *
 *  Returns the number of characters converted.
 */
template <typename Iter16>
size_t utf32_to_utf16(uint32_t c, Iter16& first, Iter16& last, bool strict)
{
    // limits
    static constexpr uint32_t max_utf32 = 0x0010FFFF;
    static constexpr uint32_t high_begin = 0xD800;
    static constexpr uint32_t low_begin = 0xDC00;
    static constexpr uint32_t max_bmp = 0x0000FFFF;
    static constexpr int shift = 10;
    static constexpr uint32_t base = 0x0010000UL;
    static constexpr uint32_t mask = 0x3FFUL;

    // variables
    if (c <= max_bmp) {
        if (c >= high_begin && c <= low_begin) {
            *first++ = assert_strict(strict);
        } else {
            *first++ = utf16_t(c);
        }
    } else if (c > max_utf32) {
        *first++ = assert_strict(strict);
    } else {
        if (first + 1 > last) {
            return 0;
        }

        c -= base;
        *first++ = utf16_t((c >> shift) + high_begin);
        *first++ = utf16_t((c & mask) + low_begin);
    }

    return 1;
}


/** \brief Convert UTF-32 character to UTF-8.
 *
 *  Returns the number of characters converted.
 */
template <typename Iter8>
size_t utf32_to_utf8(uint32_t c, Iter8& first, Iter8 last, bool strict)
{
    // limits
    static constexpr uint32_t max_utf32 = 0x0010FFFF;
    static constexpr uint32_t bytemark = 0x80;
    static constexpr uint32_t bytemask = 0xBF;

    // calculate bytes to write
    short bytes;
    if (c < 0x80) {
        bytes = 1;
    } else if (c < 0x800) {
        bytes = 2;
    } else if (c < 0x10000) {
        bytes = 3;
    } else if (c <= max_utf32) {
        bytes = 4;
    } else {
        bytes = 3;
        c = assert_strict(strict);
    }

    // check range
    if (first + bytes > last) {
        return 0;
    }

    // write to buffer
    first += bytes;
    switch (bytes) {
        case 4:
            *--first = utf8_t((c | bytemark) & bytemask);
            c >>= 6;
        case 3:
            *--first = utf8_t((c | bytemark) & bytemask);
            c >>= 6;
        case 2:
            *--first = utf8_t((c | bytemark) & bytemask);
            c >>= 6;
        case 1:
            *--first = utf8_t(c | FIRST_BYTE_MARK[bytes]);
    }
    first += bytes;

    return 1;
}


/**
 *  \brief Convert UTF16 characters to UTF32.
 *
 *  Returns the number of characters converted.
 */
template <typename Iter16>
size_t utf16_to_utf32(uint32_t& c, Iter16 &first, Iter16 last, bool strict)
{
    // limits
    static constexpr uint32_t high_begin = 0xD800;
    static constexpr uint32_t high_end = 0xDBFF;
    static constexpr uint32_t low_begin = 0xDC00;
    static constexpr uint32_t low_end = 0xDFFF;
    static constexpr int shift = 10;
    static constexpr uint32_t base = 0x0010000UL;

    const uint32_t c1 = *first++;
    if (c1 >= high_begin && c1 <= high_end) {
        // check source buffer, check whether or not we have space to replace
        if (first + 1 >= last) {
            throw std::runtime_error("Not enough input characters for a full code point.");
        }

        // surrogate pairs
        const uint32_t c2 = *first++;
        if (c2 >= low_begin && c2 <= low_end) {
            c = ((c1 - high_begin) << shift) + (c2 - low_begin) + base;
        } else {
            c = assert_strict(strict);
        }
        return 2;
    } else if (c1 >= low_begin && c1 <= low_end) {
        c = assert_strict(strict);
    } else {
        c = c1;
    }

    return 1;
}


/**
 *  \brief Convert UTF-8 character to UTF-32.
 *
 *  Returns the number of characters converted.
 */
template <typename Iter8>
size_t utf8_to_utf32(uint32_t& c, Iter8 &first, Iter8 last, bool strict)
{
    c = 0;
    uint8_t bytes = UTF8_BYTES[*first];

    // check source buffer, check whether or not we have space to replace
    if (first + bytes >= last) {
        goto fail;
    }

    // get our UTF-32 character
    switch (bytes) {
        case 5:
            c = assert_strict(strict);
            c <<= 6;
        case 4:
            c = assert_strict(strict);
            c <<= 6;
        case 3:
            if (!is_valid_byte(*first, c, strict))
                goto fail;
            c += *first++;
            c <<= 6;
        case 2:
            if (!is_valid_byte(*first, c, strict))
                goto fail;
            c += *first++;
            c <<= 6;
        case 1:
            if (!is_valid_byte(*first, c, strict))
                goto fail;
            c += *first++;
            c <<= 6;
        case 0:
            if (!is_valid_byte(*first, c, strict))
                goto fail;
            c += *first++;
    }
    c -= UTF8_OFFSETS[bytes];

    return bytes + 1;

fail:
    c = 0;
    return 0;
}


// HELPERS -- ARRAYS
// -----------------


/**
 *  \brief Convert UTF8 to UTF16.
 *
 *  \return     Number of bytes written to dst.
 */
template <typename Iter8, typename Iter16>
size_t utf8_to_utf16_array(Iter8 &src_first, Iter8 src_last,
                           Iter16 &dst_first, Iter16 dst_last,
                           bool strict = true)
{
    // convert bytes
    auto src = src_first;
    auto dst = dst_first;
    while (src < src_last && dst < dst_last) {
        uint32_t c;
        if (!utf8_to_utf32(c, src, src_last, strict)) {
            break;
        }
        if (!utf32_to_utf16(c, dst, dst_last, strict)) {
            break;
        }
    }

    // get progress
    size_t distance = std::distance(dst_first, dst);
    src = src_first;
    dst = dst_first;

    return distance;
}


/**
 *  \brief Convert UTF8 to UTF32.
 *
 *  \return     Number of bytes written to dst.
 */
template <typename Iter8, typename Iter32>
size_t utf8_to_utf32_array(Iter8 &src_first, Iter8 src_last,
                           Iter32 &dst_first, Iter32 dst_last,
                           bool strict = true)
{
    // convert bytes
    auto src = src_first;
    auto dst = dst_first;
    while (src < src_last && dst < dst_last) {
        if (!utf8_to_utf32(*dst++, src, src_last, strict)) {
            break;
        }
    }

    // get progress
    size_t distance = std::distance(dst_first, dst);
    src = src_first;
    dst = dst_first;

    return distance;
}


/**
 *  \brief Convert UTF16 to UTF8.
 *
 *  \return     Number of bytes written to dst.
 */
template <typename Iter16, typename Iter8>
size_t utf16_to_utf8_array(Iter16 &src_first, Iter16 src_last,
                           Iter8 &dst_first, Iter8 dst_last,
                           bool strict = true)
{
    // convert bytes
    auto src = src_first;
    auto dst = dst_first;
    while (src < src_last && dst < dst_last) {
        uint32_t c;
        if (!utf16_to_utf32(c, src, src_last, strict)) {
            break;
        }
        if (!utf32_to_utf8(c, dst, dst_last, strict)) {
            break;
        }
    }

    // get progress
    size_t distance = std::distance(dst_first, dst);
    src = src_first;
    dst = dst_first;

    return distance;
}


/**
 *  \brief Convert UTF16 to UTF32.
 *
 *  \return     Number of bytes written to dst.
 */
template <typename Iter16, typename Iter32>
size_t utf16_to_utf32_array(Iter16 &src_first, Iter16 src_last,
                            Iter32 &dst_first, Iter32 dst_last,
                            bool strict = true)
{
    // convert bytes
    auto src = src_first;
    auto dst = dst_first;
    while (src < src_last && dst < dst_last) {
        if (!utf16_to_utf32(*dst++, src, src_last, strict)) {
            break;
        }
    }

    // get progress
    size_t distance = std::distance(dst_first, dst);
    src = src_first;
    dst = dst_first;

    return distance;
}


/**
 *  \brief Convert UTF32 to UTF8.
 *
 *  \return     Number of bytes written to dst.
 */
template <typename Iter32, typename Iter8>
size_t utf32_to_utf8_array(Iter32 &src_first, Iter32 src_last,
                           Iter8 &dst_first, Iter8 dst_last,
                           bool strict = true)
{
    // convert bytes
    auto src = src_first;
    auto dst = dst_first;
    while (src < src_last && dst < dst_last) {
        if (!utf32_to_utf8(*src++, dst, dst_last, strict)) {
            break;
        }
    }

    // get progress
    size_t distance = std::distance(dst_first, dst);
    src = src_first;
    dst = dst_first;

    return distance;
}


/**
 *  \brief Convert UTF32 to UTF16.
 *
 *  \return     Number of bytes written to dst.
 */
template <typename Iter32, typename Iter16>
size_t utf32_to_utf16_array(Iter32 &src_first, Iter32 src_last,
                            Iter16 &dst_first, Iter16 dst_last,
                            bool strict = true)
{
    // convert bytes
    auto src = src_first;
    auto dst = dst_first;
    while (src < src_last && dst < dst_last) {
        if (!utf32_to_utf16(*src++, dst, dst_last, strict)) {
            break;
        }
    }

    // get progress
    size_t distance = std::distance(dst_first, dst);
    src = src_first;
    dst = dst_first;

    return distance;
}


